PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?team WHERE {
  wd:Q169452 p:P54 ?stmt1 .
  ?stmt1 ps:P54 ?team .
  OPTIONAL {
    ?stmt1 pq:P580 ?start1
  }
  .
  OPTIONAL {
    ?stmt1 pq:P582 ?end1
  }
  .
  wd:Q25369 p:P54 ?stmt2 .
  ?stmt2 ps:P54 ?team .
  OPTIONAL {
    ?stmt2 pq:P580 ?start2
  }
  .
  OPTIONAL {
    ?stmt2 pq:P582 ?end2
  }
  .
  FILTER ( ( ! BOUND( ?end1 ) || ?end1 >= "2000-01-01T00:00:00Z" ^^ xsd:dateTime ) && ( ! BOUND( ?start1 ) || ?start1 <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime ) ) FILTER ( ( ! BOUND( ?end2 ) || ?end2 >= "2000-01-01T00:00:00Z" ^^ xsd:dateTime ) && ( ! BOUND( ?start2 ) || ?start2 <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime ) )
}

