PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?person1 ?person2 ?state WHERE {
  wd:Q2926117 wdt:P19 ?birthplace1 .
  ?birthplace1 wdt:P131 * ?state .
  ?state wdt:P17 wd:Q30 .
  wd:Q87192979 wdt:P19 ?birthplace2 .
  ?birthplace2 wdt:P131 * ?state .
  FILTER ( ?state = ?state ) OPTIONAL {
    ?state rdfs:label ?stateLabel .
    FILTER ( LANG( ?stateLabel ) = 'en' )
  }
  OPTIONAL {
    wd:Q2926117 rdfs:label ?person1Label .
    FILTER ( LANG( ?person1Label ) = 'en' )
  }
  OPTIONAL {
    wd:Q87192979 rdfs:label ?person2Label .
    FILTER ( LANG( ?person2Label ) = 'en' )
  }
  BIND( IF( BOUND( ?person1Label ) , ?person1Label , 'Brooke Raboutou' ) AS ?person1 ) BIND( IF( BOUND( ?person2Label ) , ?person2Label , 'Colin Duffy' ) AS ?person2 ) BIND( IF( BOUND( ?stateLabel ) , ?stateLabel , 'Colorado' ) AS ?state )
}
LIMIT 1

